import { Fragment } from "react";
import ToDoItem from "./ToDoItem";


const TodoList = (props) =>{

return (
    <Fragment>

        <ul>
        props.todos.map(todo => <ToDoItem todo ={todo} />
    
    
    )

        </ul>

    </Fragment>
)

}

export default TodoList;
